import { View, Text,TextInput, StyleSheet } from 'react-native'
import React from 'react'

const CustomInput = () => {
  return (
    <View style = {styles.container}>
      <TextInput
      style = {styles.input} 
      placeholder='place'/>
    </View>
  )
}
const styles = StyleSheet.create({
    container:{
        width: '100%',
        paddingVertical: 10

    },
    input:{}
})

export default CustomInput
